tables.table_schema:
CREATE TABLE preprocessed_data (
    id INT PRIMARY KEY,
    data VARCHAR
);

CREATE TABLE ModelData (
    id INT PRIMARY KEY,
    data TEXT
);

CREATE TABLE ModelLabels (
    id INT PRIMARY KEY,
    label TEXT
);

CREATE TABLE preprocessed_data (
    id INT PRIMARY KEY,
    feature_1 FLOAT,
    feature_2 FLOAT,
    target VARCHAR
);

CREATE TABLE model_parameters (
    parameter_name VARCHAR PRIMARY KEY,
    parameter_value FLOAT
);

CREATE TABLE data_statistics (
    stat_name VARCHAR PRIMARY KEY,
    stat_value FLOAT
);

CREATE TABLE preprocessing_data (
    id INT PRIMARY KEY,
    data_name VARCHAR(255),
    data_type VARCHAR(50),
    preprocessing_steps TEXT
);

CREATE TABLE training_data (
    id INT PRIMARY KEY,
    dataset_name VARCHAR(255),
    features TEXT,
    target_variable VARCHAR(50)
);

CREATE TABLE model_details (
    model_id INT PRIMARY KEY,
    model_name VARCHAR(100),
    algorithm VARCHAR(50),
    hyperparameters JSON
);

CREATE TABLE model_performance (
    model_id INT,
    evaluation_metric VARCHAR(50),
    metric_value FLOAT,
    PRIMARY KEY (model_id, evaluation_metric)
);

CREATE TABLE data_sources (
    source_id INT PRIMARY KEY,
    source_name VARCHAR(255),
    source_type VARCHAR(50),
    source_description TEXT
);
